    { (yylhs.value.astNode) = driver.makeAstNode<VacuumAnalyzeStmtAST>( (yystack_[4].value.location), (yystack_[3].value.location), (yystack_[2].value.location), (yystack_[1].value.location), (yystack_[0].value.astNode)->asAnalyzeStmt() ); }

