  case 137:

    { (yylhs.value.vacuumOptList) = driver.makeAstNode<VacuumOptionListAST>( (yystack_[0].value.astNode)->asVacuumOption() ); }

    break;

  case 138:

    { (yylhs.value.vacuumOptList) = driver.makeAstNode<VacuumOptionListAST>( (yystack_[2].value.vacuumOptList), (yystack_[0].value.astNode)->asVacuumOption() ); }

    break;

  case 139:

    { (yylhs.value.astNode) = driver.makeAstNode<VacuumOptionAST>( (yystack_[0].value.location) ); }

    break;

  case 140:

    { (yylhs.value.astNode) = driver.makeAstNode<VacuumOptionAST>( (yystack_[0].value.location) ); }

    break;

  case 141:

    { (yylhs.value.astNode) = driver.makeAstNode<VacuumOptionAST>( (yystack_[0].value.location) ); }

    break;

  case 142:

    { (yylhs.value.astNode) = driver.makeAstNode<VacuumOptionAST>( (yystack_[0].value.location) ); }

    break;

  case 144:

    { (yylhs.value.location) = 0; }

    break;

  case 146:

    { (yylhs.value.location) = 0; }

    break;

  case 147:

    { (yylhs.value.astNode) = driver.makeAstNode<TruncateStmtAST>( (yystack_[4].value.location), (yystack_[3].value.location), (yystack_[2].value.relExprList), (yystack_[1].value.astNode)->asTruncateRestartClause(), (yystack_[0].value.location) ); }

    break;

  case 148:

    { (yylhs.value.astNode) = driver.makeAstNode<TruncateRestartClauseAST>( (yystack_[1].value.location), (yystack_[0].value.location) ); }

