    { (yylhs.value.astNode) = driver.makeAstNode<TruncateRestartClauseAST>( (yystack_[1].value.location), (yystack_[0].value.location) ); }

    break;

  case 151:

    { (yylhs.value.astNode) = driver.makeAstNode<BeginTransactionStmtAST>( (yystack_[2].value.location), (yystack_[1].value.location), (yystack_[0].value.transModeList) ); }

    break;

